    false,nt"url": null,nt"notes": "This narrative report for Fort Niobrara
    National Wildlife Refuge outlines Refuge accomplishments from November, 1940 to
    January of 1941. The report begins by summarizing the weather conditions. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, and reptiles- is also covered. The Refuge development and maintenance section
    discusses physical developments. The public relations section of the report describes
    recreational uses and Refuge visitors. Resource management is outlined; topics include
    haying and cooperative farming. Photographs are attached.",nt"license_title":
